  input: TEXT,F3XN,,"Allocation of three separate H4 expenses paid to Goldenrod Printing
    in the amounts of $234.60, $1748.81 and $2075.80 are split between federal and
    non-federal in ratios different than the 25%/75& split.  This is due to the fact
    that there were numerous expenses on the invoices paid.  While most of expenses
    on each of the payments should be split on the normal ratio, there were expenses
    on each payment that should be at another split (either totally non-federal or
    on a time and space ratio).  Each expense was split separately and added together
    to get the amounts allocated to federal expense.  This split would accurately
    allocate the expense between federal and non-federal funds."
